import pg from "pg";



const db = new pg.Client({
  user: "postgres",
  host: "localhost",
  database: "Keeper",
  password: "123456",
  port: 5432,
});
db.connect();

async function getData(){
  const result = await db.query("SELECT * FROM notes")
  console.log(result)
}

export default getData;
